// src/components/Navbar.jsx
import { Link, NavLink } from "react-router-dom";
import { Menu, X } from "lucide-react";
import { useState } from "react";
import { useLanguage } from "../context/LanguageContext";
import { translations } from "../utils/translations";

export default function Navbar() {
  const [open, setOpen] = useState(false);
  const { language, toggleLanguage } = useLanguage();
  const t = translations[language] ?? {};

  return (
    <header className="bg-[#0f0f11] border-b border-white/10 text-white sticky top-0 z-50">
      <div className="max-w-6xl mx-auto flex items-center justify-between px-4 py-3 md:py-4">
        {/* Logo */}
        <Link to="/" className="flex items-center gap-2">
          <img
            src="/logo.png"
            alt="Logo"
            className="w-10 h-10 object-contain"
          />
          <span className="font-bold text-lg">{t.navBrand || "Portfolio"}</span>
        </Link>

        {/* Desktop nav */}
        <nav className="hidden md:flex gap-x-6 text-sm">
          <NavLink
            to="/"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navHome || "Home"}
          </NavLink>
          <NavLink
            to="/about"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navAbout || "About"}
          </NavLink>
          <NavLink
            to="/projects"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navProjects || "Projects"}
          </NavLink>
          <NavLink
            to="/credentials"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navCredentials || "Credentials"}
          </NavLink>
          <NavLink
            to="/certificates"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navCertificates || "Certificates"}
          </NavLink>
          <NavLink
            to="/blog"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navBlog || "Blog"}
          </NavLink>
          <NavLink
            to="/contact"
            className={({ isActive }) =>
              `hover:text-purple-400 transition ${
                isActive ? "text-purple-400" : "text-white/70"
              }`
            }
          >
            {t.navContact || "Contact"}
          </NavLink>
        </nav>

        {/* Language switcher + Mobile button */}
        <div className="flex items-center gap-3">
          <button
            onClick={toggleLanguage}
            className="text-xs border border-white/20 px-3 py-1 rounded-lg hover:bg-white/10 transition"
          >
            {language === "en" ? "IT" : "EN"}
          </button>
          <button
            className="md:hidden"
            onClick={() => setOpen((prev) => !prev)}
          >
            {open ? <X size={24} /> : <Menu size={24} />}
          </button>
        </div>
      </div>

      {/* Mobile nav */}
      {open && (
        <div className="md:hidden bg-[#0f0f11] border-t border-white/10 px-4 py-4 flex flex-col gap-4 text-sm">
          <NavLink
            to="/"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navHome || "Home"}
          </NavLink>
          <NavLink
            to="/about"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navAbout || "About"}
          </NavLink>
          <NavLink
            to="/projects"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navProjects || "Projects"}
          </NavLink>
          <NavLink
            to="/credentials"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navCredentials || "Credentials"}
          </NavLink>
          <NavLink
            to="/certificates"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navCertificates || "Certificates"}
          </NavLink>
          <NavLink
            to="/blog"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navBlog || "Blog"}
          </NavLink>
          <NavLink
            to="/contact"
            onClick={() => setOpen(false)}
            className="hover:text-purple-400 transition"
          >
            {t.navContact || "Contact"}
          </NavLink>
        </div>
      )}
    </header>
  );
}
